        path: "page-intro",
        options: {
            initialState: "overview",
            definition: "b-page-intro-copy",
            name: "b-page-intro-copy",
            states: {
                overview: {copy: "Your career in the Air Force officially begins with Basic Military Training (BMT). It is a challenging experience both mentally and physically but will ultimately transform you from humble recruit to confident Airman with the skills and confidence you need to excel as a member of the U.S. Air Force."},
                preparation: {copy: "BMT will require you to push yourself harder and further than you ever thought possible. Before you arrive, it’s important that you prepare not only for your training, but also your transition into an Airman and Air Force life."},
                week_0: {copy: "Once you step off the bus, your journey officially begins. You’ll be assigned to a Military Training Instructor (MTI) who will give you direction and guide you through your transformation during the next seven and half weeks."},
                week_1: {copy: "Designed to challenge you both mentally and physically, you’ll learn the basics of Air Force life and condition your body for the physical requirements needed to graduate."},
                week_2: {copy: "Learn about the Air Force’s proud history and rich heritage as you begin preparing for your role as an elite warrior in the world’s preeminent air and space power."},
                week_3: {copy: "You’ll learn and embrace your role in countering diverse threats to national security, including terrorist attacks and chemical, biological, radiological, nuclear and explosive (CBRNE) weapons."},
                week_4: {copy: "You’ll learn defensive fighting techniques and lifesaving skills so you’ll know what to do while under enemy fire and have the knowledge you need to save your life and those of your fellow Airmen."},
                week_5: {copy: "Regarded as the most challenging week of BMT, you’ll begin honing your skills through field training exercises and combat scenarios designed to bring out the wingman and warrior in you."},
                week_6: {copy: "Final evaluations of your physical fitness and airmanship skills will begin to take place, and you’ll continue to learn more about the history and heritage of the Air Force."},
                week_7: {copy: "You’ll celebrate your accomplishment in front of friends and family with the Airman’s Run and graduation ceremony."},
                week_8: {copy: "A final step before you head off to tech training, this week will be spent reinforcing core values and what it means to be an Airman in today’s Air Force."}
            }
        }
