        path: "gun-heading",
        options: {
            initialState: "overview",
            definition: "heading-block-03",
            name: "gun-heading-block",
            states: {
                overview: null,
                preparation: null,
                week_0: {
                    title: "Hair clipper",
                    bodyCopy: "When you get to BMT, everyone starts as equals, and it all begins with a haircut. All male recruits must shave their heads and female recruits are required to keep their hair high and tight in a two-inch bun or above their collar."
                },
                week_1: {
                    title: "Organized drawer",
                    bodyCopy: "Attention to detail in your personal space will translate into everything you do. And when your mission depends on performance, that focus will help ensure your success."
                },
                week_2: {
                    title: "M16",
                    bodyCopy: "Learning to disassemble and assemble your M16 training weapon is an essential part of your training. With quick hands and a lot of practice, the whole process can be completed in under 30 seconds."
                },
                week_3: {
                    title: "Gas mask",
                    bodyCopy: "When you’re exposed to CS gas during the CBRNE gas chamber exercise, you can expect burning eyes and a nose full of mucus. The effects will last a matter of minutes, but you can expect to remember the experience long after."
                },
                week_4: {
                    title: "Credit card",
                    bodyCopy: "When you know the right techniques, anything can be used to help save a life. Like using a credit card to help seal an open wound. First aid training will help prepare you to save the lives of yourself and your wingmen should the need arise."
                },
                week_5: {
                    title: "Combat dummy",
                    bodyCopy: "Pugil sticks are a great way to hone your combat skills. Your training will start with dummies, but you’ll soon put your skills to the test with a fellow trainee who will not only be more challenging but also hits back."
                },
                week_6: {
                    title: "Field rations",
                    bodyCopy: "Field rations can be essential to your survival on a mission. Meals Ready to Eat (MRE) come in a variety of flavors and are designed to provide 4,200 calories of fuel to keep you going when you need it most."
                },
                week_7: {
                    title: "Warhawk",
                    bodyCopy: "The Warhawk designation is reserved for the most physically fit trainees. To get this honor, you must be able to run 1½ miles in 8:55 and do 65 push-ups, 70 sit-ups and 10 pull-ups, each under a minute by graduation."
                },
                week_8: {
                    title: "Airmen’s Week",
                    bodyCopy: "A final step before you head off to tech training, this week will be spent reinforcing core values and what it means to be an Airman in today’s Air Force."
                }
            }
        }
