                overview: {copy: "When you join the Air Force as a healthcare, legal or ministry professional, you’ll begin your Air Force career with Commissioned Officer Training—a 5.5-week program organized into four phases designed to help ease your transition from the private sector into military life. Through physical conditioning and classroom studies, you’ll develop the skills necessary to serve your country and your profession as an Officer and a leader."},
                preparation: {copy: "In the first phase of Commissioned Officer Training, you’ll focus on teamwork, discipline and standardization. You’ll begin to learn the fundamentals of leadership and military management while also experiencing the common activities in military training that teach “attention to detail” and the need to operate as a team."},
                week_0: {copy: "In phase two of your training, you’ll further develop your understanding of the Air Force culture and the fundamentals of leadership. You will work as a team with your fellow trainees to accomplish certain tasks that promote efficient teamwork, encourage conflict resolution and establish working relationships in order for your group to grow as a team."},
