        options: {content: "Another way you can attend law school if you are currently an active duty Air Force Officer is through our Excess Leave Program (ELP). This option allows you to pursue your legal ambitions while on what is known as “excess leave.” However, this type of leave isn’t counted against your leave account and does not have to be repaid.Through this program, you will be responsible for all application expenses, tuition and fees. You also won’t receive pay or allowances. However, you will continue to accrue time for promotion and retirement purposes, and you’ll remain eligible for other active duty benefits such as base exchange, commissary and medical services."}
