            copy: "Participation in the ELP results in a four-year Active Duty Service Commitment (ADSC) if the program is completed. If the program is not completed, participants will have an ADSC of one month for each month of participation. This ADSC runs consecutive to any existing service commitment. Any preexisting ADSC will toll during law school and begin again upon completion of the bar exam.",
