            subTitle: "You’ll start your career as a JAG with a training regimen both in the ways of military life and military law, beginning with Commissioned Officer Training (COT) and followed by the Judge Advocate Staff Officer Course (JASOC). Throughout this training, you’ll live at Maxwell AFB, Alabama, in the on-base dormitories.<br><br>Throughout your career, you’ll have opportunities for ongoing professional education, including participating in seminars and earning a Master of Laws (LL.M.) degree. You’ll also participate in education programs to develop and hone your leadership skills."
