        path: "jag-benefits-block[0] benefit-copy",
        options: {copy: 'The USAF Judge Advocate General’s Corps currently has a Student Loan Repayment Program (JA-SLRP). Under this program, eligible JAGs can apply for up to $65,000 toward student loan repayment. Payments are made directly to a qualified lender over a three-year period, starting after you have completed the first year of service as a JAG officer. In addition, many Judge Advocates may benefit from the Public Service Loan Forgiveness Program and income-based loan repayment plan of the <u><a href="http://www.equaljusticeworks.org/ed-debt" target="_blank">College Cost Reduction and Access Act of 2007.</a></u> <br><br>For continuing education costs, you may also be able to receive benefits under the Post-9/11 GI Bill. It’s even possible to transfer your benefits to your spouse or dependent children. <br><br><u><a href="' + o + 'data/pdf/financial_incentives_brochure_TJAG.pdf" target="_blank">View details</a></u> on loan repayment and financial incentives offered.'}
